{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/dinishsubaramaniam/cyclistic-2022?scriptVersionId=130436049\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"6ad202ad","metadata":{"papermill":{"duration":0.017333,"end_time":"2023-05-21T16:49:35.275231","exception":false,"start_time":"2023-05-21T16:49:35.257898","status":"completed"},"tags":[]},"source":["# #**Case Study 1: How Does a Bike-Share Navigate Speedy Success?**\n","\n","Author: Dinish Subaramaniam\n","\n","Date: 16/05/2023\n","\n","Welcome to the Cyclistic bike-share analysis case study! As a data analyst I will perform and follow the steps of the data analysis process: ask, prepare, process, analyze, share, and act to answer the key business questions for a fictional company, Cyclistic."]},{"cell_type":"markdown","id":"f3c81cb3","metadata":{"papermill":{"duration":0.015162,"end_time":"2023-05-21T16:49:35.307142","exception":false,"start_time":"2023-05-21T16:49:35.29198","status":"completed"},"tags":[]},"source":["# Background\n","\n","**Scenario**\n","\n","I am a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, my team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, my team will design a new marketing strategy to convert casual riders into annual members. \n","\n","**About the company**\n","\n","In 2016, Cyclistic launched a successful bike-share oering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n","Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","Cyclistic’s finance analysts have concluded that annual members are much more profitable than casual riders. Although the pricing flexibility helps Cyclistic attract more customers, The director of marketing believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, she believes there is a very good chance to convert casual riders into members. She notes that casual riders are already aware of the Cyclistic program and have chosen Cyclistic for their mobility needs."]},{"cell_type":"markdown","id":"25241b0a","metadata":{"papermill":{"duration":0.015407,"end_time":"2023-05-21T16:49:35.337695","exception":false,"start_time":"2023-05-21T16:49:35.322288","status":"completed"},"tags":[]},"source":["**The goal of this case study**\n","\n","Three questions will guide the future marketing program:\n","1. How do annual members and casual riders use Cyclistic bikes differently?\n","2. Why would casual riders buy Cyclistic annual memberships?\n","3. How can Cyclistic use digital media to influence casual riders to become members?"]},{"cell_type":"markdown","id":"7df14ce7","metadata":{"papermill":{"duration":0.015055,"end_time":"2023-05-21T16:49:35.367856","exception":false,"start_time":"2023-05-21T16:49:35.352801","status":"completed"},"tags":[]},"source":["**The director of marketing has assigned me the first question to answer: How do annual members and casual riders use Cyclistic bikes differently?**\n","\n","In this assignment, I will produce a report with the following deliverables:\n","1. A clear statement of the business task\n","2. A description of all data sources used\n","3. Documentation of any cleaning or manipulation of data\n","4. A summary of my analysis\n","5. Supporting visualizations and key findings"]},{"cell_type":"markdown","id":"538f8d4e","metadata":{"papermill":{"duration":0.015147,"end_time":"2023-05-21T16:49:35.398187","exception":false,"start_time":"2023-05-21T16:49:35.38304","status":"completed"},"tags":[]},"source":["# **Ask**\n","\n","\n","1. Business Task:\n","In order to maximize the number of annual membership, I, data analyst, will find trend and patterns among casual riders and membership riders, hat would help to design marketing strategies aimed at converting casual riders into annual members. I do not need to raise awareness of annual membership among casual riders as they are already aware of the program. \n","\n","2. Stakeholders\n","- The director of marketing\n","- The marketing analysis team\n","- Cyclistic's Executive team\n","\n","3. Stakeholder's expectation: \n","Design marketing strategies aimed at converting casual riders into annual members. In order to do that, however, the marketing analyst team needs to better understand how annual members and casual riders differ, why casual riders would buy a membership, and how digital media could affect their marketing tactics. The marketing team is interested in analyzing the Cyclistic historical bike trip data to identify trends."]},{"cell_type":"markdown","id":"43634a0d","metadata":{"papermill":{"duration":0.015009,"end_time":"2023-05-21T16:49:35.42831","exception":false,"start_time":"2023-05-21T16:49:35.413301","status":"completed"},"tags":[]},"source":["# **Prepare**\n","\n","\n","1. DATA TYPE check\n","2. ROOOC Check \n","*     Sampling bias\n","*     Observer bias\n","*     Interpretation bias\n","*     Confirmation bias"]},{"cell_type":"markdown","id":"69c45c94","metadata":{"papermill":{"duration":0.015587,"end_time":"2023-05-21T16:49:35.458915","exception":false,"start_time":"2023-05-21T16:49:35.443328","status":"completed"},"tags":[]},"source":["About the data set:\n","\n","Since Cyclistic is a fictional company, I will use Divvy’s, a bike-share program based in Chicago, data from January 2022 - December 2022 to complete this case study. To download the data, please use [this link](http://divvy-tripdata.s3.amazonaws.com/index.html). This data was made public by Motivate International Inc, under [this license](http://www.divvybikes.com/data-license-agreement). Due to data privacy issues, personal information has been removed or encrypted."]},{"cell_type":"code","execution_count":1,"id":"603407e3","metadata":{"execution":{"iopub.execute_input":"2023-05-21T16:49:35.493388Z","iopub.status.busy":"2023-05-21T16:49:35.491095Z","iopub.status.idle":"2023-05-21T16:49:36.602239Z","shell.execute_reply":"2023-05-21T16:49:36.600692Z"},"papermill":{"duration":1.13102,"end_time":"2023-05-21T16:49:36.604985","exception":false,"start_time":"2023-05-21T16:49:35.473965","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.0     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.1     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.1.8\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[3