 365826        \n","13 casual        Sunday      251037        \n","14 member        Sunday      318486        "]},"metadata":{},"output_type":"display_data"}],"source":["#Number of rides by casual riders & members on each day\n","all_trips_v3 %>%    \n","    group_by(member_casual, day_of_week) %>%\n","    summarise(number_of_ride = n(), .groups = 'drop') %>%\n","    arrange(day_of_week)"]},{"cell_type":"markdown","id":"cab610c1","metadata":{"papermill":{"duration":0.025049,"end_time":"2023-05-21T16:52:44.132031","exception":false,"start_time":"2023-05-21T16:52:44.106982","status":"completed"},"tags":[]},"source":["**Findings:** \n","1. **Members ride more than casual riders every day:** Members have a higher number of rides than casual riders on all days of the week. This shows that members are more actively using Cyclistic's services across the week.\n","\n","2. **Weekday vs. Weekend usage:** For casual riders, the number of rides increases on the weekends, with the highest numbers on Saturday and Sunday. This suggests that casual riders may be using Cyclistic's services more for leisure or non-work related activities that are more common on weekends.\n","\n","3. **Consistent usage among members:** For members, the usage is more evenly distributed across all days of the week, although there is a slight decrease on the weekends. This could indicate that members are using the bikes for commuting to work or school during weekdays, in addition to leisure activities.\n","\n","4. **Peak usage:** The highest number of rides for casual riders occurs on Saturday, while for members it's on Thursday. This could reflect different usage patterns - casual riders may be more likely to go on leisure rides during the weekend, while members may be using the bikes more heavily for commuting during the week.\n","\n","5. **Conversion opportunities:** The high number of rides by casual users during the weekend shows potential for conversion to membership. Offering promotions or incentives for weekend riders to become members could be a strategy to increase the number of annual members.\n","\n","6. **Marketing strategies:** Given these usage patterns, marketing strategies could be tailored to the different user types. For example, marketing efforts for casual riders could highlight weekend leisure rides, while for potential members, the convenience of bike commuting could be emphasized."]},{"cell_type":"code","execution_count":25,"id":"5cd1cc25","metadata":{"execution":{"iopub.execute_input":"2023-05-21T16:52:44.184991Z","iopub.status.busy":"2023-05-21T16:52:44.183691Z","iopub.status.idle":"2023-05-21T16:52:44.234825Z","shell.execute_reply":"2023-05-21T16:52:44.233288Z"},"papermill":{"duration":0.080388,"end_time":"2023-05-21T16:52:44.237375","exception":false,"start_time":"2023-05-21T16:52:44.156987","status":"completed"},"tags":[]},"outputs":[],"source":["#Assign the correct order to each month of the year\n","all_trips_v3$month <-\n","  ordered(all_trips_v3$month, levels = c('01', '02', '03', '04', '05', '06', '07', '08', '09', '10', '11', '12'))"]},{"cell_type":"code","execution_count":26,"id":"21ddc790","metadata":{"execution":{"iopub.execute_input":"2023-05-21T16:52:44.290603Z","iopub.status.busy":"2023-05-21T16:52:44.289277Z","iopub.status.idle":"2023-05-21T16:52:44.420023Z","shell.execute_reply":"2023-05-21T16:52:44.417819Z"},"papermill":{"duration":0.159933,"end_time":"2023-05-21T16:52:44.422509","exception":false,"start_time":"2023-05-21T16:52:44.262576","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 24 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>member_casual</th><th scope=col>month</th><th scope=col>number_of_ride</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;ord&gt;</th><th scope=col>&lt;int&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>casual</td><td>01</td><td> 14618</td></tr>\n","\t<tr><td>member</td><td>01</td><td> 75408</td>