ay to June, after which the distance remains relatively consistent up until November.\n","\n","   - Casual Riders: They show a consistent pattern from March to August, with the average distance ridden remaining fairly stable. The distance decreases slightly from September to October and then rises again in November. \n","\n","3. **Shortest Distances:** The shortest average distances ridden by both types of users are in January and February, likely due to the harsh winter weather conditions.\n","\n","4. **Longest Distances:** The longest average distances ridden by both types of users are in November. Members ride slightly longer distances on average than casual riders, suggesting that members might be more committed or accustomed to riding in less ideal weather conditions.\n","\n","5. **Closing Gap:** The gap between casual riders and members in terms of average distance ridden decreases as the year progresses. This could suggest that casual riders are becoming more comfortable and riding longer distances as they get more experience, or it could be a result of seasonal factors."]},{"cell_type":"markdown","id":"4d24b3ba","metadata":{"papermill":{"duration":0.026924,"end_time":"2023-05-21T16:52:49.163498","exception":false,"start_time":"2023-05-21T16:52:49.136574","status":"completed"},"tags":[]},"source":["As a support to my findings, let's analyze which types of bikes are most popular with casual riders vs. annual members."]},{"cell_type":"code","execution_count":31,"id":"81f7c377","metadata":{"execution":{"iopub.execute_input":"2023-05-21T16:52:49.221915Z","iopub.status.busy":"2023-05-21T16:52:49.220149Z","iopub.status.idle":"2023-05-21T16:52:49.32392Z","shell.execute_reply":"2023-05-21T16:52:49.321886Z"},"papermill":{"duration":0.135865,"end_time":"2023-05-21T16:52:49.326538","exception":false,"start_time":"2023-05-21T16:52:49.190673","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 2 × 2</captio