ATyDYAQAAAPAE\ngh0AAAAATyDYAQAAAPAEgh0AAAAATyDYAQAAAPDE/wPxpb1sjCn7MwAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["#Top 10 end stations for member riders\n","all_trips_v3 %>%\n","  group_by(member_casual, end_station_name, end_station_id) %>%\n","  summarise(number_of_rides = n(), .groups = \"drop\") %>%\n","  filter(member_casual == \"member\") %>%\n","  filter(!end_station_name == \"\") %>%\n","  arrange(desc(number_of_rides)) %>%\n","  head(10) %>%\n","  ggplot(aes(x = reorder(end_station_name, number_of_rides), y = number_of_rides, fill = member_casual)) +\n","  geom_bar(stat = \"identity\", fill = \"coral3\") +\n","  coord_flip() +\n","  labs(title = \"Top 10 End Stations for Member Riders\", \n","       x = \"Start Station\", \n","       y = \"Number of Rides\")"]},{"cell_type":"markdown","id":"ab798fa4","metadata":{"papermill":{"duration":0.036598,"end_time":"2023-05-21T16:53:02.93737","exception":false,"start_time":"2023-05-21T16:53:02.900772","status":"completed"},"tags":[]},"source":["**Conclusion:**\n","\n","1. **User Segmentation:** Cyclistic's user base can be segmented into two main groups: casual riders and annual members. Casual riders are individuals who purchase single-ride or full-day passes, while annual members are customers who opt for annual memberships. Annual members are more profitable for Cyclistic, and maximizing their number is crucial for the company's future success.\n","\n","2. **Usage Patterns:** Annual members exhibit more frequent and regular usage patterns compared to casual riders. They tend to use Cyclistic bikes for commuting purposes and are more likely to ride on weekdays. Casual riders, on the other hand, show a higher inclination to use the service for leisure and weekend rides.\n","\n","3. **Bike Preference:** Both casual riders and annual members show a preference for electric bikes and classic bikes over docked bikes. This preference could be attributed to the ease of use, comfort, and the ability to cover longer distances with electric bikes. Understanding this preference can help Cyclistic optimize their bike fleet and ensure the availability of preferred bike types.\n","\n","4. **Ride Frequency:** The bike-sharing service experiences higher ride frequencies on weekdays compared to weekends, indicating that it is commonly used for commuting or regular daily activities. Ride frequency also tends to be higher during the warmer months, suggesting that weather conditions impact the demand for bike rides.\n","\n","5. **Ride Duration:** Average ride durations remain relatively consistent throughout the week and across different months, implying that riders have consistent ride durations regardless of the day or season. This information can help in managing resources and estimating ride times for users.\n","\n","6. **Ride Distance:** Most rides have distances below a certain threshold, indicating that the majority of riders tend to take shorter rides. This suggests that the bike-sharing service is utilized for short-distance commuting, leisurely rides within a limited area, or quick errands."]},{"cell_type":"markdown","id":"6a81c4d9","metadata":{"papermill":{"duration":0.035553,"end_time":"2023-05-21T16:53:03.009088","exception":false,"start_time":"2023-05-21T16:53:02.973535","status":"completed"},"tags":[]},"source":["**Recommendation:**\n","\n","1. **Targeted Marketing Campaigns:** Design and implement targeted marketing campaigns aimed at converting casual riders into annual members. Utilize digital media platforms, such as email and social media, to highlight the benefits of annual memberships, such as cost savings, convenience, and access to exclusive features. Tailor the messaging and incentives to address the specific needs and motivations of casual riders, showcasing the value proposition of becoming an annual member.\n","\n","2. **Optimize Bike Fleet:** Based on the preference for electric bikes and classic bikes, optimize the bike fleet by ensuring an adequate supply of these preferred bike types. Conduct regular maintenance and inspections to keep the bikes in good condition, prioritize repairs for the preferred bike types, and consider expanding the fleet of electric bikes to meet the demand. By providing the preferred bike options, Cyclistic can enhance customer satisfaction and attract more riders.\n","\n","3. **Spatial Expansion and Station Optimization:** Conduct spatial analysis to identify areas with high ride demand, popular routes, and underutilized stations. Use these insights to guide spatial expansion plans, considering additional docking stations in high-demand areas and adjusting station capacities based on usage patterns. Optimize station distribution to ensure convenient access for riders and improve the overall user experience. Monitor and analyze station performance regularly to identify opportunities for expansion or relocation based on changing user behavior and demand."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":211.098773,"end_time":"2023-05-21T16:53:03.46606","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-05-21T16:49:32.367287","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}